import { Badge } from '@material-ui/core';

import { Search, ShoppingCartOutlined } from '@material-ui/icons';
import React from 'react';
import styled from 'styled-components';
import {mobile} from '../Responsive';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { signOut } from '../redux/apiCalls';

const Container = styled.div`
height:60px;
${mobile({height:"50px",marginBottom:"5px"})}
`
const Wrapper = styled.div`
  padding: 10px 20px;
 display: flex;
 justify-content: space-between;
 align-items: center;
${mobile({padding:"10px 0px"})}
`

const Left = styled.div`
flex: 1;
display: flex;
align-items: center;
`;
const Right = styled.div`
flex: 1;
display: flex;
justify-content: flex-end;
align-items: center;
${mobile({flex:2,justifyContent:"center"})}
`;
const Center = styled.div`
flex: 1;
display: flex;
align-items: center;
text-align: center;
justify-content: center;
`;

const Languages = styled.span`
  font-size: 14px;
  cursor: pointer;
  ${mobile({display:"none"})}
`
const SearchContainer = styled.div`
border: 0.5px solid lightgray;
display: flex;
align-items: center;
margin-left: 25px;
padding: 5px;
`;

const Input = styled.input`
  border: none;
  ${mobile({width:"50px"})}
`;

const Logo = styled.h1`
font-weight: bold;
${mobile({fontSize:"24px",marginLeft:"10px"})}
`

const MenuItem = styled.div`
  cursor: pointer;
  font-size: 14px;
  margin-left: 25px;
  ${mobile({fontSize:"12px",marginLeft:"10px"})}
`
const Navbar = () => {
  const quantity = useSelector(state=>state.cart.quantity);
  const user = useSelector(state=>state.customer.currentCustomer);
  const dispatch = useDispatch();
  const handleClick = ()=>{
    dis
  }
  
  return (
    <Container>
      <Wrapper>
       <Left>
        <Languages>
          EN
        </Languages>
        <SearchContainer>
          <Input placeholder='Search'/>
          <Search style={{color:"gray",fontSize:16,cursor:"pointer"}}/>
        </SearchContainer>
        </Left>
        <Center><Logo>LAMA.</Logo></Center>
       <Right>

        <MenuItem>{!user && 'REGISTER'}</MenuItem>
        <MenuItem>{!user ?'SIGN IN' : user.email}</MenuItem>
        <MenuItem onClick={handleClick} style={{color:'red'}}>{user && 'SignOut'}</MenuItem>
        <Link to="/cart">
        
        <MenuItem>
        <Badge badgeContent={quantity} color="primary">
        <ShoppingCartOutlined/>
        </Badge>
        </MenuItem>
        </Link>
       </Right>
       
       
      </Wrapper>
      
    </Container>
  )
}

export default Navbar
